DROP TABLE IF EXISTS `dm_alarminfo`;
CREATE TABLE `dm_alarminfo`  (
  `id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '自增ID',
  `device_code` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '设备编号',
  `send_time` datetime(0) NULL DEFAULT NULL COMMENT '上送时间',
  `event_count` int(11) NULL DEFAULT NULL COMMENT '上送事件个数',
  `event_type` int(11) NULL DEFAULT NULL COMMENT '事件类型: 1-预警事件 2-巡检事件 3-报警事件 4-电器事件 5-故障事件 6-维保事件 7-火灾事件 8-液压事件 9-液位事件',
  `event_desc` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '事件详情',
  `alarm_time` datetime(0) NULL DEFAULT NULL COMMENT '报警时间',
  `alarm_type_id` int(11) NULL DEFAULT NULL COMMENT '报警类型',
  `alarm_type` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '记录值类型',
  `alarm_value` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '记录值',
  `device_status` tinyint(2) NOT NULL DEFAULT 0 COMMENT '设备状态 ：0 未处理  1 已处理',
  `extend_2` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '预留字段2',
  `append_time` datetime(0) NULL DEFAULT NULL COMMENT '添加时间',
  `handle_time` datetime(0) NULL DEFAULT NULL COMMENT '处理时间',
  `handle_person` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '处理人',
  `handle_result` tinyint(2) NULL DEFAULT NULL COMMENT '处理结果',
  `handle_reason` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '原因',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `alarmTypeID`(`alarm_type_id`) USING BTREE,
  INDEX `eventType`(`event_type`) USING BTREE,
  INDEX `idx_device_code`(`device_code`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '事件上送数据' ROW_FORMAT = Dynamic;

